import React from 'react';
import SignIn from './Components/Login/SignIn';
import Home from './Components/Home/Home';
import { Route, BrowserRouter as Router, Switch} from 'react-router-dom'

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <SignIn />
        </Route>
        {/* <Route path="/home">
          <Home />
        </Route> */}
      </Switch>
    </Router>
  );
}

export default App;
